double GetGoldenChannelMoneyComponents(LeptonVectors &leptons, string Component, bool Reverse, bool UpType)
{
   if(Component == "A-")
      return GetDiffCxn4VecSZZ(leptons, Reverse, UpType);
   else if(Component == "A")
      return GetDiffCxn4VecSZZpZA(leptons, Reverse, UpType);
   else if(Component == "B")
      return GetDiffCxn4VecTAndUZA(leptons, Reverse, UpType);
   else if(Component == "C")
      return GetDiffCxn4VecTAndUZZ(leptons, Reverse, UpType);
   else if(Component == "AB" || Component == "A+B" || Component == "BA" || Component == "B+A")
      return GetDiffCxn4VecSAndTIntZA(leptons, Reverse, UpType);
   else if(Component == "BC" || Component == "B+C" || Component == "CB" || Component == "C+B")
      return GetDiffCxn4VecTAndUIntZAZZ(leptons, Reverse, UpType);
   else if(Component == "AC" || Component == "A+C" || Component == "CA" || Component == "C+A")
      return GetDiffCxn4VecSAndTIntZZ(leptons, Reverse, UpType);
   else if(Component == "AC+" || Component == "A+C+" || Component == "CA+" || Component == "C+A+")
      return GetDiffCxn4VecSAndTIntZZpZA(leptons, Reverse, UpType);
   else
      std::cerr << "[GetGoldenChannelMoneyComponents] Error!  Wrong component choice"
         << "\"" << Component << "\"" << std::endl;

   return -1;   // ERROR
}

